        if(id === "Signup"){ 
            return( <div> hello</div>)
        } else if ( id === "Logine" ){
            return(<div> Logine</div>)
        }else {
            <div> Register</div>
        }

    }


    return (
        <div>
            {Page(id)}
            client stuff : {id}
        </div>
    )
}
